query:
mutation policySocketLanRemoveSection ( $policyRemoveSectionInput:PolicyRemoveSectionInput! $socketLanPolicyMutationInput:SocketLanPolicyMutationInput $accountId:ID! ) {
	policy ( accountId:$accountId ) {
		socketLan ( input:$socketLanPolicyMutationInput  )  {
			removeSectionSocketLanPolicyMutations: removeSection ( input:$policyRemoveSectionInput   ) {
				section  {
					auditPolicySectionPayload: audit {
						updatedTime 
						updatedBy 
					}
					sectionPolicySectionPayload: section {
						id 
						name 
					}
					propertiesPolicySectionPayload: properties
				}

				status 
				errors  {
					errorMessage
					errorCode
				}

			}
		}

	}	
}
